import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

class Login extends Component {

    render() {
      return (
      
        <div className="main">
        <div className ="main2">
      <Form onSubmit={this.onSubmit}>
        <h3>Details of deceased:</h3>
        <Form.Group controlId="formGridClientid">
          <Form.Label>Client id (If in possession)</Form.Label>
          <Form.Control type="username" name='cid' onChange={this.onChange} />
        </Form.Group>
          <Form.Group  controlId="formGridFname">
            <Form.Label>First name *</Form.Label>
            <Form.Control type="password" name='fname' onChange={this.onChange} required />
          </Form.Group>

          

        

        <Button variant="primary" type="submit" >
          LOGIN
  </Button>
      </Form>
      </div>
      </div>

      );
    }
  }
  
  export default Login;
